import Header from './components/Header';
import Navbar from './components/Navbar';
import Details from './pages/details';

function App() {
  return (
    <div className="flex flex-row h-screen">
    <div className="h-full bg-gray-800">
      <Navbar/>
    </div>
    <div className="flex-1 ">
        <Details />
      </div>
  </div>
);
}







export default App;
